import React from "react";
import styled, { ThemeProvider } from "styled-components";
import { Header, Transition, Button, Particles, Modal } from "arclight-react";

const _Header_ = styled.div``;

const _Modal = (props) => (
  <Modal
    theme={props.theme}
    visible={props.status}
    disableClickAway
    crown={{
      position: "right",
      constrain: false,
      content: (
        <div>
          <img src={require("./img/spirit-flower.png")} />
          <div style={{ position: "absolute", top: -55, left: -55 }}>
            <Particles
              width={300}
              height={300}
              animations={[
                {
                  name: "spiritual",
                  particleColor: "#00fff0",
                  x: 50,
                  y: 50,
                },
              ]}
              invoke={false}
            />
          </div>
        </div>
      ),
    }}
    setVisible={(a) => props.showModal(a)}
  >
    <h1 style={{ color: "black" }}>
      <i>Azir, Emperor of Shurima</i>
    </h1>
    <TextArea
      readonly={true}
      value={story}
      height={"300px"}
      theme={"light"}
      placeholder={"Some sample text goes in here."}
      onChange={(e) => console.log(e.target.value)}
    />
  </Modal>
);

export default class _ extends React.Component {
  state = {
    modalSatus: false,
  };

  showModal(modalStatus) {
    this.setState({ modalStatus });
  }

  render() {
    return (
      <ThemeProvider theme={{}}>
        <_Modal
          showModal={(boolean) => this.showModal(boolean)}
          status={this.state.modalStatus}
        />
        <_Header_>
          <Header
            name={"StylishCenter"}
            textDisplay={{
              left: (
                <Transition trans={{ animation: "fadeInLeft", delay: 2 }}>
                  <h1>
                    <b>
                      <i>Titan eSports</i>
                    </b>
                  </h1>
                </Transition>
              ),
              center: null,
              right: (
                <Transition trans={{ animation: "fadeInRight", delay: 2 }}>
                  <img src={require("./img/divinity.png")} height={"45px"} />
                </Transition>
              ),
            }}
            theme={"Dark"}
            info={{
              width: "100%",
              height: "175px",
              crown: (
                <Transition trans={{ animation: "fadeIn", delay: 1.25 }}>
                  <div
                    style={{
                      position: "relative",
                      width: "125px",
                      height: "150px",
                    }}
                  >
                    <img
                      src={require("./img/logo-divinity.png")}
                      style={{
                        height: "150px",
                      }}
                    />
                    <div style={{ position: "absolute", top: -20, left: -55 }}>
                      <Particles
                        width={300}
                        height={200}
                        animations={[
                          {
                            name: "spiritual",
                            particleColor: "#00fff0",
                            x: 50,
                            y: 100,
                          },
                        ]}
                        invoke={false}
                      />
                    </div>
                  </div>
                </Transition>
              ),
            }}
            controls={[]}
          />
        </_Header_>
      </ThemeProvider>
    );
  }
}
